        //Adds an image to the place-holder div
        function addImg(index, src, error) {
            var page = '#Page' + index + ' .PageContent';
            var img = "<img id='PageImg" + index + "' alt='PageImg" + index + "' src='" + src + "'/>";
            $(page).append(img).slideToggle();
            $("#ThumbNailImg" + index).attr("src", src);
            if(settings.DownloadZip == "true"){
				var str = '' + index;
                while (str.length < 3) str = '0' + str;
				var filename = "Page "+str;
				if(src.indexOf("base64") > -1){
					filename += ".png";
					var base64 = src;
					var i = base64.indexOf(",");
					if (i !== -1) {
						base64 = base64.substring(index + 1, base64.length);
					}
					cache.zip.file("Manga/"+filename,base64,{base64:true,createFolders:true});
					cache.downloadFiles++;
				} else {
					GM_xmlhttpRequest({
						method: "GET",
						responseType: 'blob',
						url: src,
						onload: function(e) {
							var blob = e.response;
							reader = new FileReader();
							reader.onload = function (event){
								if(event.loaded == event.total){															
									filename += src.match(/\.(jpeg|jpg|png)$/)[0];
									console.log(filename+" Added to Zip File");		  
									cache.zip.file("Manga/"+filename,event.target.result,{binary:true,createFolders:true});
									cache.downloadFiles++;
								}
							}
							reader.readAsBinaryString(blob);						  
						}
					});
				}
            }
        }
        
        //Adds an optional image just in case the primary does not load
